const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <blockquote>
      <p parentName="blockquote">{`⚠️ `}<em parentName="p">{`This section is not up to date.`}</em></p>
    </blockquote>
    <p><img parentName="p" {...{
        "src": "assets/extensions/overview/Items.png",
        "alt": "Overview Extensions"
      }}></img></p>
    <p>{`The VHDP Boards feature a plug and play experience together with the `}<a parentName="p" {...{
        "href": "/docs/component_vhdpshield"
      }}>{`VHDP Shield`}</a>{` and often have more features than the usual development boards. To make including the boards in your project as easy as possible, they all have documentation, libraries and examples that are included natively in the VHDP IDE.`}</p>
    <h2 {...{
      "id": "overview"
    }}>{`Overview`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "/docs/extension_adc"
            }}>{`ADC Extension`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`8 Analog inputs`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "/docs/extension_bluetooth"
            }}>{`Bluetooth Extension`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Bluetooth UART transfer`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Control Extension`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Buttons, LEDs und Joystick`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "/docs/extension_dcmotor"
            }}>{`DC Motor Extension`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Motor driver and connection for encoder`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "/docs/extension_io"
            }}>{`IO Extension`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Extension for more in- and outputs`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "/docs/extension_led"
            }}>{`LED Extension`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Extension to control 8 additional LEDs`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`LCD Extension`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`16x2 character LCD display`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "/docs/extension_levelshifter"
            }}>{`Level Shifter Extension`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`To connect 5V components to the 3.3V FPGA`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Microcontroller Extension`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Use an arduino microcontroller together with the VHDP extensions`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Power Switch Extension`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`To toggle components that draw more current`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`RTC Extension`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Real time clock for current time, date and temperature`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Servo Extension`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`To control 3 servo motors`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Shift Register Extension`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`For expandable outputs`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Stepper Motor Extension`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`To drive stepper motors`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`USB Extension`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`To transfer data via USB`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "/docs/extension_wifi"
            }}>{`WiFi Extension`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Arduino compatible microcontroller with WiFi module`}</td>
        </tr>
      </tbody>
    </table>

    </MDXLayout>;
}

;
